tables.table_schema:
CREATE TABLE survey_demographics (
    survey_id INT PRIMARY KEY,
    demographic_category VARCHAR(50),
    demographic_value VARCHAR(50)
);

CREATE TABLE respondent_demographics (
    respondent_id INT PRIMARY KEY,
    age INT,
    gender VARCHAR(10),
    income_range VARCHAR(50)
);

CREATE TABLE surveys (
 survey_id INT PRIMARY KEY,
 survey_name VARCHAR(100),
 creation_date DATE
);

CREATE TABLE demographics (
 user_id INT PRIMARY KEY,
 age INT,
 gender VARCHAR(10),
 location VARCHAR(50)
);

CREATE TABLE survey_completion (
 completion_id INT PRIMARY KEY,
 survey_id INT,
 user_id INT,
 completion_date DATE
);
